--drop database "Restaurant Management System"
create database "Restaurant Management System"
go
use "Restaurant Management System"

/*
____________________________________________________________________________________________________________________________________________________________

															Table Creation
____________________________________________________________________________________________________________________________________________________________
*/

create table City
	(CityID			char(5)		primary key,
	 CityName		varchar(20),
	 CityPostalCode	varchar(10)
	 );

create table Branch
	(BranchID		char(5)			primary key,
	 Address		varchar(100),
	 PhoneNumber	char(10),
	 PostCode		char(5),
	 CityID			char(5)		foreign key references City(CityID)
	);

create table Department
	(DepartmentID	char(5)			primary key,
	 Name			varchar(20),
	 NumberOfEmployees	numeric(3),
	 TelephoneExt	varchar(3),		
	 BranchID		char(5)			foreign key references Branch(BranchID)	
	);

create table Employee
	(EMID			char(5)			primary key,
	 Name			varchar(30),
	 Salary			numeric(10),
	 CNIC			varchar(18),
	 PhoneNumber	varchar(14),
	 IsManager		bit,
	 DepartmentID	char(5)			foreign key references Department(DepartmentID),
	);

create table Chefs
	(EMID			char(5)			foreign key references Employee(EMID),
	 ShiftStart		varchar(10),
	 ShiftEnd		varchar(10),
	 IsHeadChef		Bit
	);

create table CleaningStaff
	(EMID			char(5)			foreign key references Employee(EMID),
	 ShiftStart		varchar(10),
	 ShiftEnd		varchar(10),
	 Task			varchar(50)
	);

create table Security
	(EMID			char(5)			foreign key references Employee(EMID),
	 ShiftStart		varchar(10),
	 ShiftEnd		varchar(10),
	 Area			varchar(25)
	);

create table Waiters
	(EMID			char(5)			foreign key references Employee(EMID),
	 ShiftStart		varchar(10),
	 ShiftEnd		varchar(10)
	);

create table Tables
	(TableID		char(5)			primary key,
	 TableSize		numeric(2),
	 BranchID		char(5)			foreign key references Branch(BranchID),
	 IsSmoking		Bit
	);

create table Customer
	(CusID			char(5)			primary key,
	 Name			varchar(30),
	 Phone			varchar(15),
	 TableID		char(5)			foreign key references Tables(TableID),
	 IsMember		Bit
	);

create table Reservations
	(ResID			char(5)			primary key,
	 TableID		char(5)			foreign key references Tables(TableID),
	 ResDate		varchar(10),
	 ResTime		varchar(10),
	 CusID			char(5)		foreign key references Customer(CusID)
	);

create table Menu
	(ItemID			char(5)			primary key,
	 ItemName		varchar(25),
	 ItemPrice		numeric(5)
	);

create table Orders
	(OrderID		char(5)			primary key,
	 TableID		char(5)			foreign key references Tables(TableID),
	 OrderDetails	varchar(100),
	 CusID			char(5)		foreign key references Customer(CusID)
	);

create table Invoice
	(InvoiceID		varchar(6)		primary key,
	 OrderID		char(5)			foreign key references Orders(OrderID),
	 BranchID		char(5)			foreign key references Branch(BranchID),
	 Total			numeric(6),
	 Discount		numeric(3),
	 CusID			char(5)		foreign key references Customer(CusID)	
	);

create table Feedback
	(FeedbackID		char(5)			primary key,
	 BranchID		char(5)			foreign key references Branch(BranchID),
	 CusID			char(5)		foreign key references Customer(CusID),
	 Details		varchar(100),
	 NumberOfStars	varchar(5)
	 );

create table Inventory
	(ItemID			varchar(5)		primary key,
	 ItemName		varchar(25),
	 Quantity		varchar(25),
	 PurchaseDate	varchar(10),
	 BranchID		char(5)			foreign key references Branch(BranchID)
	);

