/*
____________________________________________________________________________________________________________________________________________________________

																			Queries
____________________________________________________________________________________________________________________________________________________________
*/

/*
____________________________________________________________________________________________________________________________________________________________

										How many 2 seated non smoking tables are located in the DHA Phase3 Branch in Lahore?
____________________________________________________________________________________________________________________________________________________________
*/
SELECT 'Number of tables' = COUNT(TableID)
FROM Tables
WHERE TableSize = 2 AND BranchID  =   (SELECT BranchID
					                    FROM Branch
					                    WHERE Address = 'Shop No.16 Street 15 X Block Commercial Phase 3 DHA' AND  CityID = (SELECT CityID
										                                                                                      FROM   City
												                                                                              WHERE CityName = 'Lahore' ))
AND IsSmoking = 0

/*
____________________________________________________________________________________________________________________________________________________________
		
		What are the names and the phone numbers of the managers of different departments in the Bahria Town branch in Islamabad?
____________________________________________________________________________________________________________________________________________________________
*/
SELECT Name , PhoneNumber
FROM Employee
WHERE DepartmentID in (SELECT DepartmentID
					  FROM Department
					  WHERE BranchID =  ( SELECT BranchID
										 FROM Branch
										 WHERE Address = '40 Bahria Town, Phase 7 Bahria Town' AND  CityID IN (SELECT CityID
										                                                                         FROM   City
												                                                                 WHERE CityName = 'Islamabad' )))
AND IsManager = 1

/*
____________________________________________________________________________________________________________________________________________________________

										What amount of the restaurant’s earnings is spent on the waiters’ salaries?
____________________________________________________________________________________________________________________________________________________________
*/
SELECT SUM(Salary) AS TotalWaitersSalary  
FROM Employee
WHERE EMID IN (SELECT EMID
			   FROM Waiters)

/*
____________________________________________________________________________________________________________________________________________________________
					
					What is the sum of the salaries of employees who are working in the branches of the restaurant that are located in Karachi?
____________________________________________________________________________________________________________________________________________________________
*/
SELECT SUM(Salary) AS KarachiEmployeesSalary
FROM Employee
WHERE DepartmentID IN (SELECT DepartmentID
					  FROM Department ID
					  WHERE BranchID 	IN  (SELECT BranchID
											FROM Branch
											WHERE CityID   =   (SELECT CityID
																FROM City
															    WHERE CityName = 'Karachi')))
/*
____________________________________________________________________________________________________________________________________________________________

									How many customers have given the restaurant a 5 out of 5 star rating?
____________________________________________________________________________________________________________________________________________________________
*/
SELECT 'Count' = COUNT(CusID)
FROM Customer
WHERE CusID IN (SELECT CusID
			   FROM Feedback
			   WHERE NumberOfStars = 5)


/*
____________________________________________________________________________________________________________________________________________________________
			
						List the Items and their quantities that were purchased by the 90 Airport Rd Chaklala Cant Rawalpindi branch on 20th of september  
____________________________________________________________________________________________________________________________________________________________
*/

SELECT Distinct Inventory.ItemName, Inventory.Quantity
From Inventory,Branch
Where Inventory.PurchaseDate = '2019-09-20' and Inventory.BranchID = (Select Branch.BranchID
																	  From Branch
																	  Where Branch.Address = '90 Airport Rd Chaklala Cant')


/*
____________________________________________________________________________________________________________________________________________________________
			
										List the food items in the menu that cost less then or equal to Rs 500  
____________________________________________________________________________________________________________________________________________________________
*/

SELECT Menu.ItemName, Menu.ItemPrice
FROM   Menu	
WHERE  Menu.ItemPrice <= 500

/*
____________________________________________________________________________________________________________________________________________________________
			
								List the customers and their phone numbers that made a reservation in the DHA Phase 3 branch on the 22nd of September 
____________________________________________________________________________________________________________________________________________________________
*/

Select  Distinct Customer.Name, Customer.Phone
From Customer,Branch,Reservations
Where Customer.CusID = Reservations.CusID and Reservations.ResDate = '2019-09-22' and Branch.Address = 'Shop No.16 Street 15 X Block Commercial Phase 3 DHA'


/*
____________________________________________________________________________________________________________________________________________________________
			
							Who is the Head Chef of the 193 Jinnah Avenue, F-9 Branch? 
____________________________________________________________________________________________________________________________________________________________
*/

Select Distinct Employee.EMID,Employee.Name,Employee.PhoneNumber
From Employee,Chefs,Branch,Department
Where Employee.EMID = Chefs.EMID and Chefs.IsHeadChef = 1 and Employee.DepartmentID = Department.DepartmentID and Department.BranchID = (Select Branch.BranchID
																																		 From Branch
																																		 Where Branch.Address = '193 Jinnah Avenue, F-9')


/*
____________________________________________________________________________________________________________________________________________________________
			
							List the details of the cleaning staff in branch 5 that are tasked to clean the windows
____________________________________________________________________________________________________________________________________________________________
*/

Select Distinct Employee.Name,Employee.PhoneNumber,Employee.CNIC
From Employee,CleaningStaff,Branch,Department
Where Employee.EMID = CleaningStaff.EMID and CleaningStaff.Task = 'Cleaning windows' and Employee.DepartmentID = Department.DepartmentID and Department.BranchID = (Select Branch.BranchID
																																								  From Branch
																																								  Where Branch.BranchID = 'B0005')


/*
____________________________________________________________________________________________________________________________________________________________
			
							Get the details of the guards who's shift starts from 18:00 in Branch 10 
____________________________________________________________________________________________________________________________________________________________
*/


Select Distinct Employee.Name,Employee.PhoneNumber,Employee.CNIC
From Employee,Security,Branch,Department
Where Employee.EMID = Security.EMID and Security.ShiftStart = '18:00' and Employee.DepartmentID = Department.DepartmentID and Department.BranchID = (Select Branch.BranchID
																																								  From Branch
																																								  Where Branch.BranchID = 'B0010')


/*
____________________________________________________________________________________________________________________________________________________________
			
							Get the details of the Customers that availed 50% discount
____________________________________________________________________________________________________________________________________________________________
*/

Select Customer.Name, Customer.Phone
From Customer,Invoice
Where Invoice.Discount = 50 and Invoice.CusID = Customer.CusID


/*
____________________________________________________________________________________________________________________________________________________________
			
							Get the details of the Customers that spent more than 9000 and the branch the visited
____________________________________________________________________________________________________________________________________________________________
*/

Select Customer.Name, Customer.Phone, Branch.BranchID
From Customer,Branch, Invoice
Where Customer.CusID = Invoice.CusID and Invoice.Total > 9000 and Invoice.BranchID = Branch.BranchID



/*
____________________________________________________________________________________________________________________________________________________________
			
							Get the Department name that employs the most people
____________________________________________________________________________________________________________________________________________________________
*/

Select top 1 Department.Name, 'Number of employees' = Count(Employee.EMID)
From Department,Employee
Where Department.DepartmentID = Employee.DepartmentID
Group by Department.Name
ORDER BY 'Number of employees' DESC;

